import React from 'react';
import { motion } from 'framer-motion';

const Leadership = () => {
  const fadeIn = {
    initial: { opacity: 0, y: 20 },
    animate: { opacity: 1, y: 0 },
    transition: { duration: 0.6, ease: [0.22, 1, 0.36, 1] }
  };

  const activities = [
    {
      role: "ML Research Group Lead",
      organization: "University AI Society",
      date: "2023 - Present",
      description: "Leading a team of 15 graduate students in cutting-edge ML research projects. Organizing weekly seminars and workshops on advanced AI topics."
    },
    {
      role: "Hackathon Mentor",
      organization: "TechStart Foundation",
      date: "2022 - Present",
      description: "Mentoring aspiring developers in AI/ML projects during quarterly hackathons. Provided technical guidance to over 50 participants."
    },
    {
      role: "Conference Speaker",
      organization: "International ML Conference",
      date: "2023",
      description: "Delivered talks on 'Ethical AI Development' and 'Advances in Computer Vision' at major industry conferences."
    },
    {
      role: "Open Source Contributor",
      organization: "PyTorch Community",
      date: "2022 - Present",
      description: "Active contributor to PyTorch ecosystem. Developed and maintained popular ML model implementations and tutorials."
    }
  ];

  return (
    <section id="leadership" className="section">
      <motion.div
        initial="initial"
        whileInView="animate"
        viewport={{ once: true }}
        variants={{
          animate: { transition: { staggerChildren: 0.1 } }
        }}
      >
        <motion.h2 
          variants={fadeIn}
          className="text-h2 text-text mb-8"
        >
          Leadership & Extracurricular
        </motion.h2>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          {activities.map((activity, index) => (
            <motion.div
              key={index}
              variants={fadeIn}
              className="bg-background-dark rounded-xl p-6"
            >
              <div className="flex justify-between items-start mb-2">
                <h3 className="text-h3 text-text">{activity.role}</h3>
                <span className="text-small text-text-light">{activity.date}</span>
              </div>
              
              <p className="text-body text-primary mb-3">{activity.organization}</p>
              <p className="text-body text-text-light">{activity.description}</p>
            </motion.div>
          ))}
        </div>
      </motion.div>
    </section>
  );
};

export default Leadership;
